import React from 'react';
import './App.css';
import Dashboard from './views/dashboard/dashboard'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row } from 'react-bootstrap';
function App() {
  return (
    <Container fluid>
      <Row>
        <Col xs={6} md={4}>
          <Dashboard />
        </Col>
      </Row>
    </Container>
  );
}

export default App;
